import React, { Component } from 'react'
import { Text, View , Image , StyleSheet , TouchableOpacity } from 'react-native'

export class index extends Component {
    render() {
        const {active} = this.props
        return (
            <TouchableOpacity>
                <View style={styles.container}>
                    <Image source={require('../../assets/img/'+this.props.layanan +'.png')} style
                    ={styles.img} />
                        <Text style={styles.menu}>Click Me {active}</Text>
                </View>
            </TouchableOpacity>
        )
    }
}

export default index

const styles = StyleSheet.create({
    container : {
        padding : 10 ,
        textAlign : 'center' ,
        borderWidth :1 
    } , 

   

    img : {
        width :100 ,
        height : 100
    } ,

    menu : {
        fontSize : active ? 'bold' : 'normal'
    }
})
